export const generatePDF = async ({
  invoiceFrom,
  invoiceTo,
  date,
  dueDate,
  poNumber,
  itemName,
  itemQuantity,
  itemRate,
}: {
  invoiceFrom: string;
  invoiceTo: string;
  date: string;
  dueDate: string;
  poNumber: string;
  itemName: string;
  itemQuantity: number;
  itemRate: number;
}) => {
  const pdf = await generate({
    template,
    inputs: [
      {
        'Invoice From': invoiceFrom,
        'Invoice To': invoiceTo,
        Date: date,
        'Due Date': dueDate,
        'PO Number': poNumber,
        'Balance Due': `$${(
          (3 / 100) * (itemQuantity * itemRate) +
          itemQuantity * itemRate
        ).toFixed(2)}`,
        'Item Name': itemName,
        'Item Quantity': itemQuantity.toString(),
        Rate: `$${itemRate}`,
        Amount: `$${(itemQuantity * itemRate).toFixed(2)}`,
        Subtotal: `$${(itemQuantity * itemRate).toFixed(2)}`,
        Tax: `$${((3 / 100) * (itemQuantity * itemRate)).toFixed(2)}`,
        Total: `$${(
          (3 / 100) * (itemQuantity * itemRate) +
          itemQuantity * itemRate
        ).toFixed(2)}`,
        'Invoice No': `${Math.floor(Math.random() * 10)}`,
      },
    ],
  });

  // Node.js
  // fs.writeFileSync(path.join(__dirname, 'test.pdf'), pdf);

  // Browser
  const blob = new Blob([pdf.buffer], { type: 'application/pdf' });
  window.open(URL.createObjectURL(blob));
};
